import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./pages/Home";
import Dashboard from "./pages/Dashboard";

export default function App() {
  return (
    <Router>
      {/* Header / Navigation */}
      <header style={{ padding: "15px 30px", backgroundColor: "#282c34", color: "#fff" }}>
        <h1 style={{ margin: 0, display: "inline-block" }}>AI Enhancements App</h1>
        <nav style={{ display: "inline-block", marginLeft: "40px" }}>
          <Link to="/" style={{ color: "#61dafb", marginRight: "20px", textDecoration: "none" }}>
            Home
          </Link>
          <Link to="/dashboard" style={{ color: "#61dafb", textDecoration: "none" }}>
            Dashboard
          </Link>
        </nav>
      </header>

      {/* Main Content */}
      <main style={{ padding: "30px", minHeight: "80vh", fontFamily: "Arial, sans-serif" }}>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/dashboard" element={<Dashboard />} />
        </Routes>
      </main>

      {/* Footer */}
      <footer
        style={{
          padding: "15px 30px",
          backgroundColor: "#282c34",
          color: "#fff",
          textAlign: "center",
        }}
      >
        &copy; 2025 AI Enhancements Project | Powered by React & FastAPI
      </footer>
    </Router>
  );
}
